    true,nt"url": null,nt"notes": "The Department of the Interior, National
    Park Service, which oversees the National Register of Historic Places (NRHP), in
    2011 determined that all developed sections of all national cemeteries are eligible
    for the NRHP regardless of age. This means that all undertakings or projects at
    these cemeteries must be reviewed by state historic preservation officers per Section
    106, National Historic Preservation Act of 1966, prior to NCA awarding contracts
    or initiating work.",nt"license_title": "U.S. Government Work",nt"extras":
